import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import FirstPage from './pages/FirstPage';
import Main from './pages/Main';
import NotFound from './pages/NotFound';


function App() {
  return (
    <div className='app'>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<FirstPage/>}/>
          <Route path='/main' element={<Main/>}/>
          <Route to='/main/traval' element={<M_traval/>}/>
          <Route to='/main/book' element={<M_book/>}/>
          <Route to='/main/fashion' element={<M_fashion/>}/>
          <Route to='/main/cook' element={<M_cook/>}/>
          <Route to='/main/news' element={<M_news/>}/>
          <Route path='*' element={<NotFound/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
